import React from 'react'

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';

import Navbar from 'react-bootstrap/Navbar';




function Header() {
  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container className="container-fluid">
        <Navbar.Brand href="/">News Portal</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
      
          <Nav.Link variant="outline-success" href="/dashboard">Dashboard</Nav.Link >
          <Nav.Link href="/readnow"> Read Now</Nav.Link>
      
        </Nav>
       
        <Nav>
          <Navbar.Brand href="#">{ localStorage.getItem("user")  ? "Welcome back "+localStorage.getItem("user"):""}</Navbar.Brand>
        </Nav>
           
       
            {localStorage.getItem("user") ? (
              <Nav>
              <Nav.Link href="/logout"> Logout</Nav.Link>
              </Nav>
             
                  ) : (
                <Nav>
                <Nav.Link href="/login">Login</Nav.Link>
                <Nav.Link href="/register"> Register</Nav.Link>
                </Nav>
                  )}
          

        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Header;
